import React, { useState } from 'react';
import DatePicker from 'react-date-picker';

const Datepicker = () => {
    const [date, onDateChange] = useState(new Date());

    return (
        <div>
            <DatePicker onChange={onDateChange} value={date}/>
        </div>
    )
}

export default Datepicker;
